import React, { useState } from "react";
import styles from "./FilterButtons.module.css";

export const FilterButtons = (props) => {
  const [filterButtonSelected, setFilterButtonSelected] = useState(false);
  
  const clickHandler = (e) => {
    console.log(filterButtonSelected)
    setFilterButtonSelected((prevState) => prevState != setFilterButtonSelected);
  };
  return (
    <div className={styles["filter-buttons__wrap"]}>
      <div onClick={clickHandler} className={`${!filterButtonSelected ? '' : styles['selected-filter__button']}`}>
        All
      </div>
      <div id="IOS dev-s">IOS dev-s</div>
      <div id="Designers">Designers</div>
    </div>
  );
};
